  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then                                 U.S. Census Bureau's Master Address File
  / Topologically Integrated Geographic Encoding and Referencing (MAF/TIGER) Database
  (MTDB).n                                 The MTDB represents a seamless national
  file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
  is designed ton                                 stand alone as an independent data
  set, or they can be combined to cover the entire nation.  Congressional Districts
  are the 435 areasn                                 from which people are elected
  to the U.S. House of Representatives.  After the apportionment of congressional
  seats among the Statesn                                 based on census population
  counts, each State is responsible for establishing congressional districts for the
  purpose of electingn                                 representatives.  Each congressional
  district is to be as equal in population to all other congressional districts in
  a State asn                                 practicable.  The 115th Congress is
  seated from January 2017 to 2019. The TIGER/Line shapefiles for the District of
  Columbia, Puerton                                 Rico, and the Island Areas (American
  Samoa, Guam, the Commonwealth of the Northern Mariana Islands, and the U.S. Virgin
  Islands) eachn                                 contain a single record for the non-voting
  delegate district in these areas.  The boundaries of all other congressional districts
  aren                                 provided to the Census Bureau through the Redistricting
  Data Program (RDP).n            \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
